<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>ReuvenDev Feed With Toggle Likes</title>
  <script src="https://cdn.tailwindcss.com"></script>
  <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0/css/all.min.css" />
  <style>
    body {
      font-family: 'JetBrains Mono', 'Monaco', 'Courier New', monospace;
      background: linear-gradient(to bottom, #0d1117 0%, #161b22 100%);
      color: #c9d1d9;
    }
    .terminal {
      background-color: #0d1117;
      border: 1px solid #30363d;
      border-radius: 8px;
      box-shadow: 0 4px 8px rgba(0,0,0,0.5), inset 0 1px 2px rgba(255,255,255,0.1);
      padding: 1rem;
      margin-bottom: 1rem;
    }
    .btn-java {
      background: linear-gradient(45deg, #007bff, #4dabf7);
      border: none;
      color: #0d1117;
      transition: all 0.3s;
      cursor: pointer;
      user-select: none;
      padding: 0.5rem 1rem;
      border-radius: 8px;
      font-weight: 600;
    }
    .btn-java:hover {
      box-shadow: 0 0 20px rgba(0, 123, 255, 0.5);
      transform: translateY(-5px);
    }
    .btn-comment {
      background-color: #16a34a;
      color: #fff;
      cursor: pointer;
      user-select: none;
      border-radius: 8px;
      padding: 0.5rem 1rem;
      margin-left: 1rem;
      font-weight: 600;
      transition: background-color 0.3s ease;
    }
    .btn-comment:hover {
      background-color: #15803d;
    }
  </style>
</head>
<body>
<nav class="fixed top-0 w-full bg-gray-900/95 backdrop-blur-md z-50 border-b border-gray-700 px-6 py-4 flex justify-between items-center">

    <div class="w-8 h-8 bg-gradient-to-br from-blue-500 to-cyan-500 rounded-full flex items-center justify-center">
      <i class="fas fa-coffee text-white text-sm"></i>
    </div>
    <h1 class="text-xl font-bold text-blue">ReuvenDev</h1>
  </div>
  <button id="mobile-menu-btn" class="md:hidden text-blue"><i class="fas fa-terminal"></i></button>
</nav>
